editor de texto, dentro del body crea un titular h1 que diga **Laboratoria**\r\n 2. Debajo del h1 crea un párrafo que diga **En Laboratoria aprendemos\r\n    varios lenguajes para crear páginas web. A continuación presentamos\r\n    una lista de los lenguajes que aprendemos.**\r\n 3. Debajo del párrafo crea un titular h4 que diga **Lenguajes:**\r\n 4. Debajo del titular h4 crea una lista con 3 elementos: el primero con el texto **HTML**, el segundo con el texto **Javascript** y el tercero con el texto **PHP**\r\n 5. Al terminar presiona el botón de Guardar y Continuar\r\n\r\n*Nota importante*: debes escribir los textos idénticos a lo solicitado (incluyendo los signos de puntuación) para que el sistema reconozca tu respuesta correctamente. Si has realizado algunos cambios y deseas empezar desde cero nuevamente, puedes presionar el botón de Empezar de nuevo. ','','<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body> \r\n  </body>\r\n</html>','<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <h1>Laboratoria</h1>\r\n    <p>En Laboratoria aprendemos varios lenguajes para crear páginas web. A continuación presentamos una lista de los lenguajes que aprendemos.</p>\r\n    <h4>Lenguajes:</h4>\r\n    <ol>\r\n      <li>HTML</li>\r\n      <li>Javascript</li>\r\n      <li>PHP</li>\r\n    </ol>  \r\n  </body>\r\n</html>','¡Muy bien!|Estás rompiéndola. Presiona el botón de continuar para avanzar.','tlCnl6QCx9g',30,NULL,0,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,'Imágenes',1,'2015-11-10 15:46:24','2015-11-10 15:46:24','video',7,'','',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,'Prueba tu conocimiento: etiquetas principales',1,'2015-11-10 15:48:14','2015-11-15 01:31:19','questions',8,'','','','','','',NULL,3,0,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(9,'Tú página necesita es