,'2015-11-16 20:35:59','editor',13,'INSTRUCCIONES\r\n\r\n 1. En el editor de texto, agrega una caja adicional del mismo ancho y de la misma altura que las demás, pero de color verde (tip: verde en inglés se escribe **green**)\r\n 2. Logra que todos los contenedores estén uno al lado del otro utilizando la propiedad display y el valor inline-block\r\n 3. Al terminar presiona el botón de Guardar y Continuar','','<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <div style=\"width:50px;height:50px;background-color:red;\"></div>\r\n    <div style=\"width:50px;height:50px;background-color:blue;\"></div>\r\n    <div style=\"width:50px;height:50px;background-color:yellow;\"></div>\r\n  </body>\r\n</html>','<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <div style=\"width:50px;height:50px;background-color:red;display:inline-block;\"></div>\r\n    <div style=\"width:50px;height:50px;background-color:blue;display:inline-block;\"></div>\r\n    <div style=\"width:50px;height:50px;background-color:yellow;display:inline-block;\"></div>\r\n    <div style=\"width:50px;height:50px;background-color:green;display:inline-block;\"></div>\r\n  </body>\r\n</html>','¡Fenomenal!|No pares. Eres una coder natural. Presiona el botón de continuar para avanzar.','CExTaFKo9So',25,NULL,0,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(14,'Aprende por tu cuenta',1,'2015-11-10 15:58:16','2015-11-10 15:58:16','video',14,'','',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(15,'Prueba tu conocimiento: autoaprendizaje',1,'2015-11-10 16:02:11','2015-11-16 23:24:45','questions',15,'','','','','','',NULL,5,1,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(16,'Felicitaciones has completado el curso',1,'2015-11-10 16:14:52','2016-01-04 23:20:08','closer',16,'','<div class=\"close-container\">\r\n  <h3 class=\"text-center\">Este ha sido tu primer paso para convertirte en desarrolladora web.</h3>\r\n  <h3 class=\"text-center\">¡Sigue adelante!</h3>\r\n</div>','','','','',NULL,NULL,0,0,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(17,'Bienvenida',2,'2015-12-25 23:44:34','2015-12-26 07:15:59','opener',1,'','<div class=\"container-fluid\">\r\n  <div class=\"page-header\">\r\n    <h1>Pruebas tus conocimientos de HTML y CSS</h1>\r\n  </div>\r\n  <p>Hola coder!</p>\r\n  <p>Bienvenida, el día de hoy vamos a realizar un pequeño diagnóstico que nos permitirá medir cuanto has aprendido de los cursos de codecademy.</p>\r\n  <p>Con este ejercicio podremos ajustar mejor las futuras clases a tu ritmo de aprendizaje.</p>\r\n  <p>El Ejercicio consta de 2 partes, una parte práctica donde tendrán que codear tu primera página web y luego un pequeño cuestionario.</p>\r\n  <p>La página debe quedar cómo se ve a continuación</p>\r\n  <img src=\"https://dl.dropboxusercontent.com/u/1621947/diagnostico.png\" alt=\"Mi perfil web\">\r\n  <br><br>\r\n  <p>Tranquila, recuerda que esto nos sirve para ajustar las clases a ustedes. Bueno ¿lista para codear?</p>\r\n  <a href=\"/courses/2/units/2/pages/18\" class=\"btn btn-primary\">Lista, vamos con todo!!</a>\r\n  <br>\r\n</div>','','','','',NULL,NULL,0,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(18,'Mi perfil - Estructurando mi HTML',2,'2015-12-26 06:45:54','2015-12-28 22:01:00','editor',2,'INSTRUCCIONES\r\n\r\nBienvenida, este ejercicio tiene varios pasos pero iremos poco a poco hasta tener nuestra primera página web \r\n\r\nSigue las siguientes instrucciones:\r\n\r\n 1. Coloca un titulo en la página con tu nombre\r\n 2. Inserta una imagen similar al ejemplo que hayas encontrado en Google y que te guste.\r\n 3. Ahora has que la imagen tenga un ancho y un alto específico\r\n\r\nSi has realizado algunos cambios y deseas empezar desde cero nuevamente, puedes presionar el botón de Empezar de nuevo.','','<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n	<meta charset=\"UTF-8\">\r\n	<title>Diagnóstico Codecademy</title>\r\n</head>\r\n<body>\r\n</body>\r\n</html>','<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n	<meta charset=\"UTF-8\">\r\n	<title>(.*?)<\\/title>\r\n<\\/head>\r\n<body>\r\n  	<h1>(.*?)<\\/h1> \r\n	<img (src=\"(.*?)\"|width=\"(\\d*?)\"|height=\"(\\d*?)\") (src=\"(.*?)\"|width=\"(\\d*?)\"|height=\"(\\d*?)\") (src=\"(.*?)\"|width=\"(\\d*?)\"|height=\"(\\d*?)\")>\r\n<\\/body>\r\n<\\/html>','Muy bien!, sigue así y pronto tendrás tu primera página web completa','',10,NULL,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(19,'Mi Perfil - Tablas',2,'2015-12-26 15:51:47','2015-12-28 21:59:41','editor',3,'INSTRUCCIONES\r\n\r\nContinuamos con la segunda parte creando más contenido para nuestro perfil\r\n\r\n 1. Crea una tabla de 3x2 (3 filas por 2 columnas)\r\n 2. En la primera columna pondremos los títulos de las secciones (Biografía, Hobbies, Sueños) respectivamente. No te olvides que tienen que ir en negrita\r\n 3. En la otra columna deben ir los contenidos de la secciones\r\n   3.1. Biografía => Texto simple\r\n   3.2. Hobbies => Una lista desordenada de 3 hobbies, uno de ellos debe tener otra lista de 3 elementos\r\n   3.3. Sueños => Una lista ordenada de 3 elementos\r\n\r\nSi has realizado algunos cambios y deseas empezar desde cero nuevamente, puedes presionar el botón de Empezar de nuevo.','','','<!DOCTYPEhtml><htmllang=\"en\"><head><metacharset=\"UTF-8\"><title>(.*?)<\\/title><\\/head><body><h1>(.*?)<\\/h1><img(src=\"(.*?)\"|width=\"(\\d*?)\"|height=\"(\\d*?)\")(src=\"(.*?)\"|width=\"(\\d*?)\"|height=\"(\\d*?)\")(src=\"(.*?)\"|width=\"(\\d*?)\"|height=\"(\\d*?)\")><table><tr><td><b>(.*?)<\\/b><\\/td><td>(.*?)<\\/td><\\/tr><tr><td><b>(.*?)<\\/b><\\/td><td><ul>((<li>(.*?)<\\/li><li>(.*?)<\\/li><ul><li>(.*?)<\\/li><li>(.*?)<\\/li><li>(.*?)<\\/li><\\/ul>)|(<li>(.*?)<\\/li><ul><li>(.*?)<\\/li><li>(.*?)<\\/li><li>(.*?)<\\/li><\\/ul><li>(.*?)<\\/li>)|(<ul><li>(.*?)<\\/li><li>(.*?)<\\/li><li>(.*?)<\\/li><\\/ul><li>(.*?)<\\/li><li>(.*?)<\\/li>))<\\/ul><\\/td><\\/tr><tr><td><b>(.*?)<\\/b><\\/td><td><ol><li>(.*?)<\\/li><li>(.*?)<\\/li><li>(.*?)<\\/li><\\/ol><\\/td><\\/tr><\\/table><\\/body><\\/html>','Excelente ahora que ya tenemos el HTML ahora hay que poner bonita nuestra página web con CSS','',10,NULL,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(20,'Mi perfil - Agregando estilos',2,'2015-12-28 05:50:35','2015-12-28 22:38:08','editor',4,'INSTRUCCIONES\r\n\r\nContinuamos con la tercera parte agregando CSS a nuestra página web\r\n\r\n 1. Antes de empezar agrega el tag <style></style> **al final del head** dentro de este tag pondremos todo el CSS de nuestra página\r\n 2. Agrega un fondo de tipo imagen a la página web utiliza la imagen que aparece en la siguiente ruta: [https://dl.dropboxusercontent.com/u/1621947/fondo.png][1]\r\n 3. Has que la imagen tenga un borde redondeado de 30pixels\r\n 4. Separa la tabla de la parte superior unos 30 pixeles  y la parte inferior unos 40 pixeles y tenga un borde de 2 pixeles de color gris y un padding de 15px\r\n\r\nSi has realizado algunos cambios y deseas empezar desde cero nuevamente, puedes presionar el botón de Empezar de nuevo.\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/fondo.png','','','<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n<meta charset=\"UTF-8\">\r\n<title>(.*?)<\\/title>\r\n<style>\r\nbody {\r\nbackground-image: url\\(\"https:\\/\\/dl.dropboxusercontent.com\\/u\\/1621947\\/fondo.png\"\\);\r\n}\r\nimg {\r\nborder-radius: 30px;\r\n}\r\ntable {\r\n(margin-top: 30px;|margin-bottom: 40px;|border: 2px solid gray;|padding: 15px;)\r\n(margin-top: 30px;|margin-bottom: 40px;|border: 2px solid gray;|padding: 15px;)\r\n(margin-top: 30px;|margin-bottom: 40px;|border: 2px solid gray;|padding: 15px;)\r\n(margin-top: 30px;|margin-bottom: 40px;|border: 2px solid gray;|padding: 15px;)\r\n}\r\n<\\/style>\r\n<\\/head>\r\n<body>\