   }\r\n\r\n      img {\r\n          height:150px;\r\n          width: 150px;\r\n          border-radius: 30px;\r\n      }\r\n\r\n      table {\r\n          margin-top: 30px;\r\n          margin-bottom: 40px;\r\n          border: 2px solid gray;\r\n          padding: 15px;\r\n      }\r\n\r\n      /* Botones */\r\n\r\n      .botones a {\r\n          height: 30px;\r\n          width: 150px;\r\n          padding: 5px;\r\n          display: inline-block;\r\n          text-align: center;\r\n          background-color: green;\r\n          color: white;\r\n      }\r\n    </style>\r\n</head>\r\n<body>\r\n	<h1>Katerine Sanchez Calada</h1> \r\n	<img src=\"http://sp7.fotolog.com/photo/7/32/42/ezza_shiithaax_x/1256499473278_f.jpg\">\r\n\r\n	<table>\r\n		<tr>\r\n			<td><b>Biografia:</b></td>\r\n			<td>\r\n				Naci el 12 de Maro del 1996 en la ciudad mas alta del mundo Pasco aprendi muchos valores con mi familia\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><b>Hobbies:</b></td>\r\n			<td>\r\n				<ul>\r\n					<li>Cocinar</li>\r\n					<li>Programar</li>\r\n					<ul>\r\n						<li>Javascript</li>\r\n						<li>Ruby</li>\r\n						<li>Java</li>\r\n					</ul>\r\n				</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><b>Sueños:</b></td>\r\n			<td>\r\n				<ol>\r\n				  <li>Viajar por el mundo</li>\r\n				  <li>Aprender a programar</li>\r\n				  <li>ser una capa en programacion</li>\r\n				</ol>\r\n			</td>\r\n		</tr>\r\n	</table>\r\n\r\n	<div class=\"botones\">\r\n		<a href=\"#\" id=\"cambiar-fondo\">Cambiar fondo</a>\r\n		<a href=\"#\" id=\"cambiar-texto\">Cambiar texto</a>\r\n		<a href=\"#\" id=\"cambiar-borde\">Cambiar borde</a>\r\n	</div>\r\n\r\n	<script src=\"https://ajax.googleapis.com/ajax/libs/jquery/1.11.3/jquery.min.js\"></script>\r\n	<script>\r\n    <!-- Escribe tu codigo aqui -->\r\n    </script>\r\n</body>\r\n</html>','','Excelente, pudiste resolver todas los problemas de Javascript. Ya estás lista para seguir avanzando en laboratoria','',10,NULL,0,0,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(23,'Modelo de Caja - Estructurando',2,'2015-12-28 21:28:59','2015-12-29 15:57:42','editor',5,'Prueba tus conocimientos en HTML/CSS - Modelo de la Caja\r\n--------------------------------------------------------\r\n\r\nBienvenida, el día de hoy vamos a realizar un pequeño diagnóstico que nos permitirá medir cuanto has aprendido de los cursos de codecademy. \r\n\r\nCon este y lo demás ejercicios que vayamos a darte, podremos ajustar mejor las futuras clases a tu ritmo de aprendizaje.\r\n\r\nEl ejercicio consta de replicar la imagen que ves a continuación, utilizando lo que hayas aprendido sobre el modelo de la caja.\r\n\r\n\r\n![enter image description here][1]\r\n\r\n\r\n  [1]: http://i.imgur.com/niZbbwU.png\r\n\r\nDebajo de las instrucciones, tienes a tu alcance el editor de texto para que comiences a codear y la vista para que vayas viendo como va quedando tu ejercicio.\r\n\r\nMucha concentración y tranquilidad. Recuerda, empieza por lo más fácil. Ahora si, vamos con todo! Mucha Suerte!','','<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n	<meta charset=\"UTF-8\">\r\n	<title>Diagnóstico Codecademy</title>\r\n</head>\r\n<body>\r\n</body>\r\n</html>','<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n	<meta charset=\"UTF-8\">\r\n	<title>Diagnóstico Codecademy</title>\r\n</head>\r\n<body>\r\n</body>\r\n</html>','Terminé el ejercicio!','',10,NULL,0,0,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(24,'Floating',2,'2015-12-29 16:10:12','2015-12-29 16:10:47','editor',6,'Prueba tus conocimientos en HTML/CSS - Floating\r\n--------------------------------------------------------\r\n\r\nBienvenida, el día de hoy vamos a realizar un pequeño diagnóstico que nos permitirá medir cuanto has aprendido de los cursos de codecademy. \r\n\r\nCon este y lo demás ejercicios que vayamos a darte, podremos ajustar mejor las futuras clases a tu ritmo de aprendizaje.\r\n\r\nEl ejercicio consta de replicar la imagen que ves a continuación:\r\n\r\n![enter image description here][1]\r\n\r\nLuego de recrearlo debes de hacer lo siguiente:\r\n\r\n 1. Flota los elementos hacia la izquierda\r\n 2. Flota los elementos hacia la derecha\r\n 3. Limpia los floats\r\n\r\nTienes a tu alcance el editor de texto para que comiences a codear y la vista para que vayas viendo como va quedando tu ejercicio.\r\n\r\nMucha concentración y tranquilidad. Recuerda, empieza por lo más fácil. Ahora si, vamos con todo! Mucha Suerte!\r\n\r\n\r\n  [1]: http://i.imgur.com/Y3lVZEv.png','','<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n	<meta charset=\"UTF-8\">\r\n	<title>Diagnóstico Codecademy</title>\r\n</head>\r\n<body>\r\n</body>\r\n</html>','<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n	<meta charset=\"UTF-8\">\r\n	<title>Diagnóstico Codecademy</title>\r\n</head>\r\n<body>\r\n</body>\r\n</html>','','',NULL,NULL,0,0,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(25,'Positioning - Primera Parte',2,'2015-12-29 18:53:39','2015-12-29 18:53:39','editor',7,'Prueba tus conocimientos en HTML/CSS - Positioning\r\n--------------------------------------------------\r\n\r\nBienvenida, el día de hoy vamos a realizar un pequeño diagnóstico que nos permitirá medir cuanto has aprendido de los cursos de codecademy.\r\n\r\nCon este y lo demás ejercicios que vayamos a darte, podremos ajustar mejor las futuras clases a tu ritmo de aprendizaje.\r\n\r\nEl ejercicio consta de replicar las imágenes que ves a continuación, utilizando lo que hayas aprendido sobre positioning\r\n\r\n![enter image description here][1]\r\n\r\n![enter image description here][2]\r\n\r\n\r\n  [1]: http://i.imgur.com/PgBo7Po.png\r\n  [2]: http://i.imgur.com/mNiX1VI.png\r\n\r\nDebajo de las instrucciones, tienes a tu alcance el editor de texto para que comiences a codear y la vista para que vayas viendo como va quedando tu ejercicio.\r\n\r\nMucha concentración y tranquilidad. Recuerda, empieza por lo más fácil. Ahora si, vamos con todo! Mucha Suert